    public List<Integer> findAnagrams(String s, String p) {
        //987  ms
        //40.3 MB
        List<Integer> output = new ArrayList<>();
        boolean isAnargam = false;
        char[] sChar = s.toCharArray();
        char[] pChar = p.toCharArray();
        int pVal = 0;
        int kVal;
        Map<Character, Boolean> map = new HashMap<>();
        for(char val: pChar){
            pVal = pVal + val;
            map.put(val, true);
        }

        for (int i = 0; i < sChar.length - pChar.length + 1; i++) {
            kVal = 0;
            for (int l = i; l < pChar.length +i; l++) {
                kVal = kVal + sChar[l];
                if(map.get(sChar[l])!=null){
                    isAnargam = true;
                }else{
                    isAnargam = false;
                    break;
                }
            }
            if (isAnargam && pVal == kVal) {
                output.add(i);
            }
        }

        return output;
    }

